import React, { useState } from 'react';
import logincss from '../assets/css/login.css';
import Mainlayout from '../layout/mainlayout';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom'
import { handleError } from './util';
import { ToastContainer } from 'react-toastify';


function Register() {
    const [registerinfo,setregisterinfo]=useState({
        name:'',
        email:'',
        mobile:'',
        address:'',
        password:'',
        cpassword:'',
    });
    const handleChange=(e)=>{
        const {name,value}=e.target;
        console.log(name, value);
        const copyregisterInfo ={...registerinfo};
        copyregisterInfo[name]=value;
        setregisterinfo(copyregisterInfo);  
    }
    // const [name, setName] = useState()
    // const [email, setEmail] = useState()
    // const [mobile, setMo] = useState()
    // const [address, setAddress] = useState()
    // const [password, setPassword] = useState()
    // const [cpassword, setcPassword] = useState()
    // const navigate=useNavigate()
    const handleSubmit = async (e) => {
        e.preventDefault();
    
        const { name, email, mobile, address, password, cpassword } = registerinfo;
    
        if (!name || !email || !mobile || !address || !password || !cpassword) {
            return handleError('All fields are required');
        }
    
        if (password !== cpassword) {
            return handleError('Passwords do not match');
        }
    
        try {
            const url = "http://localhost:3001/register";
            const response = await axios.post(url, {
                name,
                email,
                mobile,
                address,
                password
            });
    
            console.log(response.data);
            // toast.success('Registration successful!');
            // navigate('/login');
        } catch (error) {
            handleError(error);
        }
    }
    
    // const handleSubmit = async (e) => {
    //     e.preventDefault()
    //     const [name,email,mobile,address,password,cpassword]=registerinfo;
    //     if(!name || !email || !mobile || !address || !password || !cpassword){
    //         return handleError('All fields are require');
    //     }
    //     // try{
