    //     //     const response =await fetch(url,{
    //     //         method ='POST',
    //     //         headers:{
    //     //             'Content-type':'application/json'
    //     //         },
    //     //         body: JSON.stringify(registerinfo)
    //     //     });
    //     //     const result =await response.json()
    //     //     console.log(result);
    //     // }
    //     // catch(err){
    //     //     handleError(err)
    //     // }
    //     // else{
    //     //     e.preventDefault()
    //     //     axios.post('http://localhost:3001/register', {name,email,mobile,address,password})
    //     //     .then(result =>{
    //     //         console.log(result)
    //     //         navigate('/login')
    //     //     })
    //     //     .catch(err=> console.log(err))
    //     // }
    // }
    
    return (
        <Mainlayout>
            <div>
                <head>
                    <meta charSet="UTF-8" />
                    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
                    <title>Login</title>
                    <link rel="stylesheet" href={logincss} />
                </head>
                <body id='loginbody'>
                    <div id="container" className="right-panel-active">
                        <div className="form-container sign-up-container">
                            <form className="frm" onSubmit={handleSubmit}>
                                <h1 className="h1" id='titleregi'>Create Account</h1>
                                <input className="inp" type="text"  onChange={handleChange} placeholder="Full Name"/>
                                <input className="inp" type="email" placeholder="Email" onChange={handleChange}   />
                                <input className="inp" type="text" placeholder="Mobile No"  onChange={handleChange} />
                                <input className="inp" type="text" placeholder="Address"  onChange={handleChange} />
                                <input className="inp" type="password" placeholder="Password"  onChange={handleChange} />
                                <input className="inp" type="password" placeholder="Confirm Password"  onChange={handleChange} />
                                <button className="lgbtn">Register</button>
                            </form>
                            <ToastContainer />
                        </div>
                        <div className="overlay-container">
                            <div className="overlay">
                                <div className="overlay-panel overlay-left">
                                    <h1 className="h1 hello">Welcome Back!</h1>
                                    <p className="para">Already have an account login here</p>
                                    <Link to="/login"><button className="ghost lgbtn" id="signIn">Sign In</button></Link>
                                </div>
                            </div>
                        </div>
                    </div>
                </body >
            </div >
        </Mainlayout>
    );
}

export default Register;
